import React from "react";
import "./index.css";

function App() {
  return (
    <div>
      <header className="header">
        <p className="logo-text">O Melhor Colchão</p>
        <nav className="nav-links">
          <a href="#compare">Compare</a>
          <a href="#blog">Blog</a>
          <a href="#faq">Perguntas Frequentes</a>
        </nav>
      </header>
      <div className="title-section">
        <h1 className="main-title">O Melhor Colchão</h1>
        <p className="sub-title">Um guia completo para escolher<br/> o melhor colchão</p>
        <a href="https://emcompre.com.br/aprenda-a-comprar-um-colchao" className="cta-button">Encontre o Melhor Colchão</a>
      </div>

      <h1>Critérios</h1>
    </div>
  );
}

export default App;
